import React from 'react';
import Puppy from '../../img/puppy.JPG'

export default function Home() {
  const styles = {
    header: {
      color: 'purple',
    },
    cont: {
      height: '100vh',
      display: 'flex',
      alignItems: 'center',
    },
    left: {
      flex: '1',
      backgroundColor: 'red',
    },
    right: {
      flex: '1',
    },
    imgcard: {
      width: '60%',
      height: '70vh',
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      backgroundColor: 'blue',
    },
    shadow: {
      width: '100%',
      height: '',
      position: 'absolute',
      top: '50px',
      left: '50px',
      backgroundColor: 'red',
      borderRadius: '30px',
    },
    image: {
      height: '100%',
      width: 'auto',
      borderRadius: '30px',
      objectFit: 'cover',
      position: 'relative',
    },
    title: {
      color: 'red',
    },
    list: {
      color: 'blue',
    },
    p: {
      color: 'yellow',
    }
  };

  return (
    <div>
      <div className='aboutHeader'>
        <h1 style={styles.header}>About Me</h1>
      </div>
      <div styles={styles.cont} className='aboutContainer'>
        <div styles={styles.left} className='aboutImageShadow'>
          <div  style={styles.imgcard} className='aboutImage'>
            <div style={styles.shadow} className='aboutShadow'></div>
            <img style={styles.image} alt='puppy' src={Puppy}></img>
          </div>
        </div>
        <div styles={styles.right} className='aboutInfo'>
          <h2 style={styles.title}>Jacob Luedke</h2>
          <ul style={styles.list}>
            <li>5'9"</li>
            <li>165lbs</li>
            <li>Fighting out of the red corner</li>
          </ul>
          <p style={styles.p}>
            Sometimes I think I can be productive when coding, and then I try to code and realize that I am wrong.
            I am not sure who is going to look at this, but if you are reading this you probably shouldn't hire me
            because I still don't really know what I am doing. Find someone better unless you want to give me extremely
            easy jobs and pay me a bunch of money.
          </p>
        </div>
      </div>
    </div>
  );
}
